const errors = {
  DEFAULT: 'Oh no!  Something went wrong, please try again',
  USERNAME_REQUIRED: 'Username is required',
  LACK_KEYWORD:"Please enter a more specific key word",
  NETWORK_ERROR: 'There was a problem reaching your network, please try again',
  "no valid session": 'You must be logged in to view this content',
  NO_VALID_SEARCH:"Please enter another keyword.",
  "action not permitted": 'You are not permitted to view this content',
  "no scuh taskId":"No such task exists.Please check agian.",
  "login denied":"You need to log in with username.",
  "failed to update":"You cannot update this task.Please check again."

};

export default errors;
